import React, { Component } from 'react'
import data from "./data.json"

class ProformaItem extends Component {
    render() {
        return(
            <table border="1">
                <thead>
                    <tr>
                {
                    data.location.map((data, j) => {
                        return(
                                
                                    
                                        <th key={j}>{data.name}</th>
                                    
                                
                        )
                    })
                }
                        <th>Description</th>
                        <th>Product</th>
                        <th>Total Stock</th>
                    </tr>
                </thead>
                <tbody>
                    
                {
                    data.proformaItem.map((data, i) => {
                        var stock = JSON.parse(data.product_stock);
                        return (
                            <tr>
                                <td>
                                    {data.product_stock}{console.log(stock[0])}
                                </td>
                                <td>
                                    {data.product_stock}{console.log(stock[1])}
                                </td>
                                <td>
                                    {data.product_stock}{console.log(stock[2])}
                                </td>
                                <td>
                                    {data.categoryDescription}
                                </td>
                                <td>
                                    {data.productDescription}
                                </td>
                            </tr>
                                    
                        )
                    })
                }
                    
                </tbody>
            </table>
        )
    }
}
export default ProformaItem
